javascript:(function(){function cleanup(){document.querySelectorAll(".ac-indicator, .ac-panel").forEach((el=>el.remove()));const existingStyle=document.querySelector("#ac-styles");if(existingStyle)existingStyle.remove()}cleanup();const fragment=document.createDocumentFragment();const elements=document.querySelectorAll("input, select, textarea");const results={valid:[],invalid:[],missing:[]};const style=document.createElement("style");style.textContent=`\n    .ac-panel {\n      position: fixed;\n      top: 10px;\n      left: 10px;\n      background: #fff;\n      padding: 15px;\n      border-radius: 5px;\n      box-shadow: 0 0 10px rgba(0, 0, 0, .2);\n      z-index: 99999;\n      max-width: 300px;\n      font-family: -apple-system, system-ui, sans-serif;\n    }\n    #ac-panel-title {\n      font-size: 1.5em;\n    }\n    .ac-stats {\n      margin: 10px 0;\n      padding: 10px;\n      background: #f5f5f5;\n      border-radius: 3px;\n    }\n    .ac-stats p {\n      margin: 5px 0;\n    }\n    .ac-indicator {\n      background-color: #ff0;\n      color: #000;\n      display: block;\n      max-inline-size: fit-content;\n      padding: 2px 5px;\n      margin-top: 2px;\n      border-radius: 3px;\n      font-size: 15px;\n      font-family: monospace;\n      font-weight: bold;\n      transition: .2s;\n    }\n    .ac-valid {\n      background-color: #cfc;\n      border-left: 4px solid #4caf50;\n    }\n    .ac-invalid {\n      background-color: #fcc;\n      border-left: 4px solid #f44336;\n    }\n    .ac-missing {\n      background-color: #ffc;\n      border-left: 4px solid #ff9800;\n    }\n    .ac-hidden {\n      display: none;\n    }\n    .ac-btn {\n      margin: 5px;\n      padding: 5px 10px;\n      border: none;\n      border-radius: 3px;\n      background: #0d6efd;\n      color: #fff;\n      cursor: pointer;\n    }\n  `;fragment.appendChild(style);const allowedValues=["on","off","name","given-name","additional-name","family-name","email","tel","url","street-address","address-line1","address-line2","address-line3","address-level1","address-level2","address-level3","address-level4","country","country-name","postal-code","cc-name","cc-given-name","cc-additional-name","cc-family-name","cc-number","cc-exp","cc-exp-month","cc-exp-year","cc-csc","cc-type","transaction-currency","transaction-amount","bday","bday-day","bday-month","bday-year","sex","gender","organization","organization-title","language","username","new-password","current-password","one-time-code","tel-country-code","tel-national","tel-area-code","tel-local","tel-extension","impp","photo","shipping-name","shipping-given-name","shipping-family-name","shipping-street-address","shipping-postal-code","shipping-country","billing-name","billing-given-name","billing-family-name","billing-street-address","billing-postal-code","billing-country","home-email","work-email","mobile-tel","home-tel","work-tel","fax-tel","pager-tel"];const allowedSections=["shipping","billing","home","work","mobile","fax","pager"];function validateAutocomplete(value){if(!value)return{isValid:false,message:"Empty value"};const parts=value.toLowerCase().split(" ");if(["on","off"].includes(parts[0])){return{isValid:parts.length===1,message:parts.length>1?"'on' and 'off' must be used alone":"Valid value"}}if(parts[0].startsWith("section-")){return{isValid:parts.length>=2&&allowedValues.includes(parts[parts.length-1]),message:parts.length<2?"Section must be followed by a value":"Valid section"}}if(allowedSections.includes(parts[0])){const isValid=parts.length>=2&&allowedValues.includes(parts[parts.length-1]);return{isValid:isValid,message:isValid?"Valid combined value":"Invalid section combination"}}return{isValid:allowedValues.includes(parts[0]),message:allowedValues.includes(parts[0])?"Valid value":"Invalid value"}}elements.forEach((function(element){if(element.hasAttribute("autocomplete")){const value=element.getAttribute("autocomplete");const validation=validateAutocomplete(value);validation.isValid?results.valid.push(element):results.invalid.push(element)}else{results.missing.push(element)}}));const panel=document.createElement("div");panel.className="ac-panel";panel.setAttribute("role","region");panel.setAttribute("aria-labelledby","ac-panel-title");panel.innerHTML=`\n    <p id="ac-panel-title">detectAutocomplete</p>\n    <div class="ac-stats">\n      <p>Total: ${elements.length}</p>\n      <p>Valid: ${results.valid.length}</p>\n      <p>Invalid: ${results.invalid.length}</p>\n      <p>Missing: ${results.missing.length}</p>\n    </div>\n    <button class="ac-btn" id="ac-toggle">Hide/Display</button>\n    <button class="ac-btn" id="ac-cleanup">Remove all</button>\n  `;fragment.appendChild(panel);elements.forEach((function(element){const label=document.createElement("p");label.className="ac-indicator";if(element.hasAttribute("autocomplete")){const value=element.getAttribute("autocomplete");const validation=validateAutocomplete(value);const parts=value.split(" ");let details=parts.length>1?` (Combined: ${parts.join(" + ")})`:"";label.innerHTML=`autocomplete="${value}"\n        <span role="${validation.isValid?"status":"alert"}">\n          ${validation.isValid?" Valid":" Invalid"}${details}\n        </span>`;label.setAttribute("data-details",validation.message);label.className+=validation.isValid?" ac-valid":" ac-invalid"}else{label.className+=" ac-missing";label.textContent="autocomplete missing";label.setAttribute("data-details","Autocomplete attribute recommended")}element.parentNode.insertBefore(label,element.nextSibling)}));document.body.appendChild(fragment);document.getElementById("ac-toggle")?.addEventListener("click",(()=>{document.querySelectorAll(".ac-indicator").forEach((el=>el.classList.toggle("ac-hidden")))}));document.getElementById("ac-cleanup")?.addEventListener("click",cleanup)})();